export const Service = ({ service }) => {
    return (
        <li>
            <p>Va a ser etiqueta imagen con la imagen del logo que tengamos del servicio</p>
            <h2>{service.title}</h2>
            <h3>{service.username}</h3>
            <p>{service.description}</p>
        </li>
    )
}
